/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `usuarios_after_update` 
AFTER UPDATE ON `usuarios`
FOR EACH ROW
BEGIN
  -- Log de cambio de estado (activación/desactivación)
  IF OLD.activo != NEW.activo THEN
    INSERT INTO `usuarios_log` (
      `usuario_afectado_id`,
      `usuario_afectado_correo`,
      `accion_realizada`,
      `detalles`
    ) VALUES (
      NEW.id,
      NEW.correo,
      IF(NEW.activo = 1, 'ACTIVACION', 'DESACTIVACION'),
      IF(NEW.activo = 1, 'Usuario reactivado', 'Usuario suspendido temporalmente')
    );
  END IF;
  
  -- Log de cambio de contraseña
  IF OLD.password != NEW.password THEN
    INSERT INTO `usuarios_log` (
      `usuario_afectado_id`,
      `usuario_afectado_correo`,
      `accion_realizada`,
      `detalles`
    ) VALUES (
      NEW.id,
      NEW.correo,
      'CAMBIO_PASSWORD',
      'Contraseña actualizada'
    );
  END IF;
  
  -- Log de cambio de rol
  IF OLD.rol != NEW.rol THEN
    INSERT INTO `usuarios_log` (
      `usuario_afectado_id`,
      `usuario_afectado_correo`,
      `accion_realizada`,
      `detalles`
    ) VALUES (
      NEW.id,
      NEW.correo,
      'CAMBIO_ROL',
      CONCAT('Rol cambiado de ', OLD.rol, ' a ', NEW.rol)
    );
  END IF;
END */;;
DELIMITER ;
